import React from 'react';
import { MDBSmoothScroll, MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavbarToggler, MDBCollapse, MDBNavItem, MDBNavLink, MDBMask, MDBBtn, MDBView} from 'mdbreact';

class Header extends React.Component {
    constructor(props) {
      super(props);
      this.state = {
        collapse: false,
        isWideEnough: false,
      };
      this.onClick = this.onClick.bind(this);
    }

    onClick() {
      this.setState({
        collapse: !this.state.collapse,
      });
    }

    render() {

    if(this.props.data) {
        var name = this.props.data.name;
        var occupation= this.props.data.occupation;
        var description= this.props.data.description;
        var city= this.props.data.address.city;
        var networks= this.props.data.social.map(function(network){
            return <li key={network.name}><a href={network.url}><i className={network.className}></i></a></li>
        })
    }

      return (
        <div className="main-wrapper">
          <header className="mainHeader">
              <MDBNavbar className="justify-content-center" color="black" fixed="top" dark expand="md" scrolling transparent>
                <MDBNavbarBrand href="/">
                  <strong>JD</strong>
                </MDBNavbarBrand>
                {!this.state.isWideEnough && <MDBNavbarToggler onClick={this.onClick} />}
                <MDBCollapse isOpen={this.state.collapse} navbar>
                   <MDBNavbarNav className="mx-auto" left>
                       <MDBNavItem active>
                         <MDBNavLink to="/">Home</MDBNavLink>
                       </MDBNavItem>
                       <MDBNavItem>
                         <MDBNavLink to="/aboutme">About Me</MDBNavLink>
                       </MDBNavItem>
                       <MDBNavItem>
                         <MDBNavLink to="#">Portfolio</MDBNavLink>
                       </MDBNavItem>
                       <MDBNavItem>
                         <MDBNavLink to="#">Contact Us</MDBNavLink>
                       </MDBNavItem>                   
                   </MDBNavbarNav>
                </MDBCollapse>
              </MDBNavbar>

            <MDBView src="https://mdbootstrap.com/img/Photos/Others/img%20(50).jpg">
              <MDBMask overlay="black-strong" className="flex-center flex-column text-white text-center">
                <h1>I Am {name}</h1>
                <h5>{occupation}</h5>
                {/* <MDBSmoothScroll to="section1">
                  <MDBBtn className="smoothscroll" rounded outline color="warning">Explore More</MDBBtn>
                </MDBSmoothScroll> */}
                <p className="scrolldown">
                    <a className="smoothscroll" href="#about"><i className="icon-down-circle"></i></a>
                </p>
              </MDBMask>
            </MDBView>
          </header>
        </div>
      );
    }
  }

  export default Header;
